from collections import Counter
class Solution:
    def solve(self, s, mydic):

        if len(set(s)) == 1:
            return s[0]

        for i in s:
            if mydic[i] > 1:
                s.remove(i)
                s = s[::-1]
                mydic[i] -= 1
                return self.solve(s, mydic)
        ans = ''.join(s)
        return ans

    def removeReverse(self, S):

        mydic = Counter(S)

        ans = self.solve(list(S), mydic)
        return ans


ans = Solution()
S = "codexcoder"
# S = "dddapplealex"
S = ""
print(ans.removeReverse(S))


